import React, { Component } from "react";
class Settings extends Component {
  state = {};
  render() {
    let rowStyle = {
      background: "white"
    };
    let btnStyle = {
      border: "border: 1px solid #eee",
      boxShadow: " 0 2px 3px #ccc",
      borderRadius: "0",
      width: "100px",
      display: "inline-box",
      background: "white",
      height: "35px"
    };
    return (
      <div className="container ">
        <div className="row mt-5" style={rowStyle}>
          <div className="col-md-3" />

          <div className="col-md-9 text-center">
            <label>
              Total budget
              <input
                type="text"
                name="totalBudget"
                style={{
                  display: "inline-box",
                  marginRight: "16px",
                  marginLeft: "16px"
                }}
              />
            </label>
            <button type="button" style={btnStyle}>
              Update
            </button>
          </div>
          <div className="col-md-2" />
        </div>

        <br />
        <div className="row mt-5" style={rowStyle}>
          <div className="col-md-3" />

          <div className="col-md-9 text-center">
            <label>
              Categories
              <input
                type="text"
                name="totalBudget"
                style={{
                  display: "inline-box",
                  marginRight: "16px",
                  marginLeft: "16px"
                }}
              />
            </label>
            <button type="button" style={btnStyle}>
              Add
            </button>
          </div>
          <div className="col-md-2" />
        </div>

        <br />
      </div>
    );
  }
}

export default Settings;
